import React from 'react'
import './index.css'

const Register=()=>{
    return(
        <div className='space-register'>
            <h3>會員註冊</h3>
            <div className='space-register-user'>
                <input type="text"  id='text' required placeholder='username'/>
                
            </div>
        </div>
    )
}
export default Register
